<!DOCTYPE html>
<html lang="es">
<head>
<meta charset="UTF-8">
<meta name="viewport" content="width=device-width,initial-scale=1,user-scalable=no">
<title>KANSUX Monitor</title>
<style>
@import url('https://fonts.googleapis.com/css2?family=JetBrains+Mono:wght@400;700;800&family=DM+Sans:wght@400;600;700&display=swap');
*{margin:0;padding:0;box-sizing:border-box;-webkit-tap-highlight-color:transparent}
:root{--bg:#060a12;--s1:#0c1220;--s2:#131c2e;--s3:#1a2540;--bd:#1e3050;--t:#f0f4f8;--t2:#8b9bb4;--t3:#576580;--cyan:#06b6d4;--grn:#10b981;--amb:#f59e0b;--red:#ef4444;--pur:#8b5cf6;--blue:#3b82f6;--M:'JetBrains Mono',monospace;--S:'DM Sans',sans-serif}
html,body{background:var(--bg);color:var(--t);font-family:var(--S);overflow-x:hidden}body{padding-bottom:66px}
.hdr{background:#080e1a;padding:12px 16px 10px;border-bottom:1px solid var(--bd);position:sticky;top:0;z-index:100}
.hr{display:flex;justify-content:space-between}.brand{font:800 9px var(--M);letter-spacing:.2em;color:var(--cyan)}.ht{font-size:15px;font-weight:700;color:#fff;margin-top:2px}
.hs{display:flex;gap:6px;align-items:center;margin-top:4px;font-size:10px;color:var(--t2)}
.dot{width:6px;height:6px;border-radius:50%;background:var(--grn);box-shadow:0 0 8px var(--grn);animation:p 2s infinite}@keyframes p{0%,100%{opacity:1}50%{opacity:.3}}
.clk{font:800 22px var(--M);color:#fff;text-align:right}.clks{font:400 9px var(--M);color:var(--t3);text-align:right;margin-top:2px}
.tabs{display:flex;background:var(--s1);border-bottom:1px solid var(--bd);overflow-x:auto;scrollbar-width:none;position:sticky;top:78px;z-index:97}.tabs::-webkit-scrollbar{display:none}
.tb{flex:0 0 auto;padding:9px 11px;font:600 10px var(--S);color:var(--t3);border:none;background:none;border-bottom:2px solid transparent;cursor:pointer;white-space:nowrap}.tb.on{color:var(--cyan);border-bottom-color:var(--cyan);background:var(--s2)}
.cnt{padding:12px}.pg{display:none}.pg.on{display:block}
.card{background:var(--s2);border-radius:12px;padding:14px;border:1px solid var(--bd);margin-bottom:10px}
.ct{font:700 9px var(--M);color:var(--t3);text-transform:uppercase;letter-spacing:.06em;margin-bottom:10px}
.kpis{display:grid;grid-template-columns:1fr 1fr;gap:8px;margin-bottom:12px}
.kpi{background:linear-gradient(145deg,var(--s2),var(--s1));border-radius:12px;padding:11px;border:1px solid var(--bd);position:relative;overflow:hidden}
.kpi::before{content:'';position:absolute;top:0;left:0;right:0;height:2px;opacity:.5}
.kpi.c::before{background:var(--cyan)}.kpi.g::before{background:var(--grn)}.kpi.a::before{background:var(--amb)}.kpi.r::before{background:var(--red)}.kpi.p::before{background:var(--pur)}
.kl{font:600 8px var(--S);color:var(--t3);text-transform:uppercase}.ki{float:right;font-size:13px;opacity:.7}.kv{font:800 20px var(--M);margin-top:3px}.ks{font:400 8px var(--M);color:var(--t3);margin-top:2px}
.bg{font:700 8px var(--M);padding:3px 7px;border-radius:4px;background:rgba(16,185,129,.15);color:var(--grn);border:1px solid rgba(16,185,129,.3)}
.ba{font:700 8px var(--M);padding:3px 7px;border-radius:4px;background:rgba(245,158,11,.15);color:var(--amb);border:1px solid rgba(245,158,11,.3)}
.br{font:700 8px var(--M);padding:3px 7px;border-radius:4px;background:rgba(239,68,68,.15);color:var(--red);border:1px solid rgba(239,68,68,.3)}
.bd2{font:700 8px var(--M);padding:3px 7px;border-radius:4px;background:rgba(100,116,139,.15);color:var(--t2);border:1px solid rgba(100,116,139,.3)}
.bp{font:700 8px var(--M);padding:3px 7px;border-radius:4px;background:rgba(139,92,246,.15);color:var(--pur);border:1px solid rgba(139,92,246,.3)}
.item{background:var(--s1);border-radius:8px;padding:10px;margin-bottom:6px;border:1px solid var(--bd)}
.ptr{width:100%;height:5px;background:var(--s1);border-radius:3px;overflow:hidden}.pfl{height:100%;border-radius:3px}
.sede{background:linear-gradient(145deg,var(--s2),var(--s1));border-radius:14px;padding:14px;border:1px solid var(--bd);margin-bottom:10px;cursor:pointer;position:relative;overflow:hidden}.sede:active{transform:scale(.98)}
.sg{display:grid;grid-template-columns:repeat(4,1fr);gap:6px}.sk{text-align:center}.skl{font:400 7px var(--M);color:var(--t3);text-transform:uppercase}.skv{font:800 13px var(--M);margin-top:2px}
.dg{display:grid;grid-template-columns:auto 1fr auto auto;gap:0;background:var(--s1);border-radius:10px;overflow:hidden;border:1px solid var(--bd)}.dr{display:contents}.dr>*{padding:8px 10px;border-bottom:1px solid var(--bd);display:flex;align-items:center}.dr:last-child>*{border-bottom:none}
.di{width:100%;background:var(--s3);border:1px solid var(--bd);border-radius:7px;color:#fff;font:700 14px var(--M);padding:7px;text-align:center;outline:none}.di:focus{border-color:var(--cyan)}
.bsel{display:flex;gap:5px;overflow-x:auto;scrollbar-width:none;margin-bottom:10px}.bsel::-webkit-scrollbar{display:none}
.bb{flex:0 0 auto;padding:7px 11px;border-radius:8px;font:600 10px var(--S);border:1px solid var(--bd);background:var(--s1);color:var(--t2);cursor:pointer;white-space:nowrap}.bb.on{background:var(--cyan);color:#fff;border-color:var(--cyan)}
.bot{position:fixed;bottom:0;left:0;right:0;z-index:100;padding:0 10px 8px;background:linear-gradient(180deg,transparent,var(--bg) 40%)}.botin{background:#0c1525;border-radius:10px;padding:9px 14px;display:flex;justify-content:space-between;align-items:center;border:1px solid var(--bd)}
/* LIVE DEMO */
@keyframes slideUp{from{transform:translateY(100%);opacity:0}to{transform:translateY(0);opacity:1}}
@keyframes fadeOut{from{opacity:1}to{opacity:0}}
@keyframes pulse2{0%,100%{box-shadow:0 0 0 0 rgba(6,182,212,.4)}50%{box-shadow:0 0 0 8px rgba(6,182,212,0)}}
@keyframes flashIn{0%{background:rgba(6,182,212,.12)}100%{background:transparent}}
.toast{position:fixed;bottom:68px;right:8px;left:8px;z-index:150;background:#0c1828ee;backdrop-filter:blur(10px);border:1px solid var(--bd);border-radius:10px;padding:8px 12px;animation:slideUp .3s ease;display:flex;gap:8px;align-items:center;box-shadow:0 -4px 20px rgba(0,0,0,.5);cursor:pointer;max-height:54px;overflow:hidden}
.toast.out{animation:fadeOut .3s ease forwards}
.toast-icon{font-size:16px;flex-shrink:0}
.toast-body{flex:1;min-width:0}.toast-title{font:700 9px var(--S);color:#fff;white-space:nowrap;overflow:hidden;text-overflow:ellipsis}.toast-msg{font:400 7px var(--M);color:var(--t3);margin-top:1px;white-space:nowrap;overflow:hidden;text-overflow:ellipsis}
.toast-bar{position:absolute;bottom:0;left:0;height:2px;border-radius:0 0 10px 10px;transition:width linear}
.toast-time{font:400 7px var(--M);color:var(--t3);flex-shrink:0}
.ticker{position:fixed;top:57px;left:0;right:0;z-index:98;background:#080e1aee;backdrop-filter:blur(8px);border-bottom:1px solid var(--bd);overflow:hidden;height:22px}
.ticker-track{display:flex;gap:30px;animation:scroll 35s linear infinite;white-space:nowrap;align-items:center;height:100%}
@keyframes scroll{from{transform:translateX(0)}to{transform:translateX(-50%)}}
.ticker-item{font:600 8px var(--M);color:var(--t2);display:flex;gap:4px;align-items:center}
.ticker-dot{width:4px;height:4px;border-radius:50%}
.live-pulse{animation:pulse2 2s infinite}
.feed-item{display:flex;gap:8px;align-items:flex-start;padding:7px 0;border-bottom:1px solid var(--bd);animation:flashIn .6s ease}
.feed-item:last-child{border-bottom:none}
.feed-ico{font-size:14px;flex-shrink:0;margin-top:1px}
.feed-body{flex:1;min-width:0}.feed-txt{font:600 9px var(--S);color:var(--t)}.feed-sub{font:400 7px var(--M);color:var(--t3);margin-top:1px}
.feed-time{font:400 7px var(--M);color:var(--t3);flex-shrink:0;margin-top:2px}
.feed-badge{font:700 7px var(--M);padding:2px 6px;border-radius:4px;flex-shrink:0;margin-top:1px}
</style>
</head>
